import React from 'react';
import Button from "react-bootstrap/Button";

const Homepage = () => {

    return (
        <div>
            <h1>Hire the best freelancers for any job, online.</h1>
            <h2>Millions of people use Ad-hawk to turn their ideas into reality</h2>
            <Button href="/alljobs">Get Started</Button> <Button type="submit">Button</Button>
        </div>
    )
};

export default Homepage;
